        <div className="video">
            <img className="video__img" alt="bike guy" src={props.videoList[0].source}></img>
            <div className="video__info">
                <p className="video__info-title"></p>
                <p className="video__info-author"></p>
            </div>

        </div>
    )

}

function NextVideos(props) {
    console.log(props.videoList[0])
